import React from 'react';

class TempUnit extends React.Component {
    state = { celsiusChecked: true };


    handleClick = () => {
        this.setState({
            celsiusChecked: !this.state.celsiusChecked
        });
        console.log("hit");
        this.props.handleUnitChange();
    }

    render() {
        return (
            <td>
                <table className="ui two very basic column table">
                    <tbody>
                        <tr>
                            <td>
                                <input
                                    type="radio"
                                    checked={this.state.celsiusChecked}
                                    onClick={this.handleClick}
                                    defaultChecked
                                />
                                <label>°C</label>
                            </td >
                            <td>
                                <input
                                    type="radio"
                                    checked={!this.state.celsiusChecked}
                                    onClick={this.handleClick}
                                />
                                <label>°F</label>
                            </td>
                        </tr>
                    </tbody>
                </table >
            </td>
        );
    }
};

export default TempUnit;
